import React from 'react';


class Next extends React.Component {
    constructor(props) {
        super(props);
        this.state = {type: this.props.types};
    }


    render() {
        return (
            <div>
                <i onClick={this.props.onclickevent} types={this.props.types} data-toggle="modal" data-target="#myModal" style={{fontSize:'24px',cursor:'pointer'}} className="fa">&#xf101;</i>
            </div>
        );
    }
}
export default Next;
